import React, { useState } from 'react';
import CSRFToken from './csrftoken';
import Cookies from 'js-cookie';
import { useParams } from "react-router-dom";

const csrftoken = Cookies.get('csrftoken');

export default function Project(){

    let {id} = useParams();

    return (
        <div>
            <h1>{id}</h1>
        </div>
    )
}
